webpackJsonp([0x7bc8b412445b],{394:function(e,a){e.exports={data:{markdownRemark:{html:"<p><em>This page is under continuous edits</em> Continuation from part three. The most relaxed part of a behavioral interview.</p>\n<h1>Logistics</h1>\n<ul>\n<li>❓ When can you start work</li>\n<li>❓ What is your expected salary</li>\n<li>❓ What is your current salary</li>\n</ul>\n<p>Was asked this question once. Not giving a current salary is probably a good answer, adding 3 - 5% of current salary is also a good way to not disclose your real salary. What the recruiter want at the end of the day is just data.</p>\n<ul>\n<li>❓ What is your highest degree</li>\n<li>❓ Are you eligible to work in {country}?</li>\n</ul>\n<p>This question is often asked as a simple yes or no. For Canadians, I read a 'lifehack' that suggest answering yes to this because its easy to get a TN visa. I would not recommend this and actually answer no. </p>\n<ul>\n<li>❓ Are you currently interviewing with other places</li>\n<li>❓ Which companies are you interviewing at? What stages?</li>\n</ul>",frontmatter:{title:"📕 Behavioral Q&A Cheatsheet End of Interview",date:"04 February, 2018",language:null,categories:"questions",carousel:null}}},pathContext:{slug:"/posts/note/2018-03-21-behavioral-part-4/"}}}});
